import React, { Component } from "react";

export default class About extends Component {
  render() {
    return (
      <div id="about" className="page-container">
        <div className="page-title">About Me</div>
        <div className="page-desc">
          Hello! I'm Hui Lin, a Singaporean web developer, currently in my 3rd
          year of studies in Ngee Ann Polytechnic's Information Technology.
          <br />
          <br />
          This is where I display my projects I've done in the course of my
          development journey :) I have special interests in web and mobile
          applications development!
          <br />
          <br />
          More about my qualifications
          <a href="https://drive.google.com/file/d/1pcZ2O3Tn-5FgJu-CZ8S2KxqPmg5R9H6h/view">
            here
          </a>
          !
        </div>
      </div>
    );
  }
}
